import React, { Component } from "react";
import { NavLink } from "react-router-dom";

export default class Culture extends Component {
    constructor(props) {
        super(props);
        this.state = {
        value: 'Please paste the original laboratory data forms from your hospital web page and the lab data will be organized in the following table',
        value_transform: '',
        };

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleOnfocus(event) {
        this.setState({value: ''});
    }

    handleChange(event) {
        this.setState({value: event.target.value});
    }

    handleSubmit(event) {
        const Lab = this.state.value;
        const B2 = Lab.search(/B2\-/);
        const BC_find = Lab.search(/ID\+DS Blood\.\#1\(\*\)/g);
        const BC1_find = Lab.search(/ID\+DS Blood\.\#1\(\)/g);
        const Seg_find = Lab.search("Seg");
        const Band_find = Lab.search("Band");

        this.setState({value_transform: ''
            .concat((this.state.value).slice(B2+26,B2+37))
            .concat('B/C: ').concat((this.state.value).slice(BC_find[0]+18,BC1_find[0]))
            .concat('B/C: ').concat((this.state.value).slice(BC_find[1]+18,BC1_find[1]))
            .concat('B/C: ').concat((this.state.value).slice(BC_find[2]+18,BC1_find[2]))
            .concat(', ').concat((this.state.value).slice(Seg_find,Seg_find+11))
            .concat(', ').concat((this.state.value).slice(Band_find,Band_find+11))
        });
        event.preventDefault();
    }

    render() {
        return (
        <form onSubmit={this.handleSubmit}>
            <br></br>
            <label>
            Lab<br></br>
            <textarea value={this.state.value} rows={8} cols={50} onFocus={this.handleOnfocus.bind(this)} onChange={this.handleChange} />
            </label>
            <br></br>
            <input type="submit" value="Transform" />
            <br></br>
            <label>
            <br></br>
            Culture selected<br></br>
            <textarea value={this.state.value_transform} rows={8} cols={50}/>
            </label>
        </form>
        );
    }
}
